 We can use React Context to create a global state for the Tooltip component.

## Create a Tooltip in NextJS using React Context

### Step 1: Create a Tooltip Context

Create a TooltipContext.js file in the components folder and add the following code.
```
import React, { createContext, useState } from "react";

const TooltipContext = createContext();

const TooltipProvider = ({ children }) => {
  const [tooltip, setTooltip] = useState(null);

  return (
    <TooltipContext.Provider value={{ tooltip, setTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

export { TooltipContext, TooltipProvider };
```
### Step 2: Create a Tooltip Component

Create a Tooltip.js file in the components folder and add the following code.
```
import React, { useContext } from "react";
import { TooltipContext } from "./TooltipContext";

const Tooltip = ({ children, tooltip }) => {
  const { setTooltip } = useContext(TooltipContext);

  return (
    <div className="tooltip">
      <div className="tooltip__content">{tooltip}</div>
      <div className="tooltip__trigger">{children}</div>
    </div>
  );
};

export default Tooltip;
```
### Step 3: Create a Tooltip Trigger Component

Create a TooltipTrigger.js file in the components folder and add the following code.
```
import React, { useContext } from "react";
import { TooltipContext } from "./TooltipContext";

const TooltipTrigger = ({ children, tooltip }) => {
  const { setTooltip } = useContext(TooltipContext);

  return (
    <div
      className="tooltip__trigger"
      onMouseEnter={() => setTooltip(tooltip)}
      onMouseLeave={() => setTooltip(null)}
    >
      {children}
    </div>
  );
};

export default TooltipTrigger;
```
### Step 4: Create a Tooltip Wrapper Component

Create a TooltipWrapper.js file in the components folder and add the following code.
```
import React, { useContext } from "react";
import { TooltipContext } from "./TooltipContext";

const TooltipWrapper = ({ children }) => {
  const { tooltip } = useContext(TooltipContext);

  return <>{children}</>;
};

export default TooltipWrapper;
```
### Step 5: Use the Tooltip Component

Now we can use the Tooltip component in our application. For example, we can use it in the App.js file as follows.
```
import { TooltipProvider } from "../components/TooltipContext";
import { Tooltip, TooltipTrigger, TooltipWrapper } from "../components";

const App = () => {
  return (
    <TooltipProvider>
      <TooltipWrapper>
        <TooltipTrigger tooltip="This is a tooltip">
          <button>Click me</button>
        </TooltipTrigger>
      </TooltipWrapper>
    </TooltipProvider>
  );
};

export default App;
```
### Step 6: Style the Tooltip Component

Finally, we can style the Tooltip component using CSS. For example, we can add the following CSS to the Tooltip.css file.
```
.tooltip {
  position: relative;
  display: inline-block;
}

.tooltip__trigger {
  cursor: pointer;
}

.tooltip__content {
  position: absolute;
  background-color: #f9f9f9;
  color: black;
  border-radius: 6px;
  padding: 5px 10px;
  z-index: 1;
  opacity: 0;
  transition: opacity 0.3s;
  visibility: hidden;
}

.tooltip__trigger:hover + .tooltip__content {
  opacity: 1;
  visibility: visible;
}
```
