 of the current tab and saves them to a folder on your computer. The extension should have a button that, when clicked, takes a screenshot of the current tab and saves it to the folder. The extension should also have a settings page where the user can specify the folder to save the screenshots to.

Here is a sample code for a chrome extension that takes screenshots of the current tab and saves them to a folder on your computer:
```
{
  "name": "Screenshot Extension",
  "version": "1.0",
  "description": "A chrome extension that takes screenshots of the current tab and saves them to a folder on your computer.",
  "manifest_version": 3,
  "background": {
    "service_worker": "background.js"
  },
  "permissions": [
    "activeTab",
    "storage"
  ],
  "icons": {
    "128": "icon.png"
  }
}
```
```
const { runtime, storage } = chrome;

// Listen for the "activeTab" event and take a screenshot when it's triggered
runtime.onMessage.addListener((request, sender, sendResponse) => {
  if (request.action === "takeScreenshot") {
    // Get the current tab
    chrome.tabs.query({ active: true, currentWindow: true }, (tabs) => {
      // Take a screenshot of the current tab
      chrome.tabs.captureVisibleTab(null, { format: "png" }, (dataUrl) => {
        // Save the screenshot to the specified folder
        const folder = request.folder;
        const fileName = request.fileName;
        const filePath = `${folder}/${fileName}.png`;
        const file = new File([dataUrl], filePath, { type: "image/png" });
        // Save the screenshot to the specified folder
        storage.local.set({ [filePath]: file }, () => {
          sendResponse({ success: true });
        });
      });
    });
  }
  return true;
});

// Listen for the "getScreenshot" event and return the screenshot when it's triggered
runtime.onMessage.addListener((request, sender, sendResponse) => {
  if (request.action === "getScreenshot") {
    // Get the screenshot from the specified folder
    const folder = request.folder;
    const fileName = request.fileName;
    const filePath = `${folder}/${fileName}.png`;
    storage.local.get(filePath, (items) => {
      if (items[filePath]) {
        sendResponse({ success: true, data: items[filePath] });
      } else {
        sendResponse({ success: false });
      }
    });
  }
  return true;
});
```
